query:
mutation CreateLabelSetMutation($input: CreateLabelSetInput!) {
  createLabelSet(input: $input) {
    ...LabelSetFragment
    __typename
  }
}

fragment LabelSetFragment on LabelSet {
  id
  name
  tagItems {
    ...TagItemFragment
    __typename
  }
  lastUsedBy {
    name
    __typename
  }
  __typename
}

fragment TagItemFragment on TagItem {
  id
  parentId
  color
  desc
  tagName
  __typename
}
